function calculateDataHash(dataObject) {
    "use strict";

    var objectProp, dataHash;

    dataHash = "";

    //Simple concatenation of the properties of the object - up to 24 vals
    for (objectProp in dataObject) {
        dataHash = dataHash + dataObject[objectProp];
    }

    return dataHash;
}

function removeOldMarks(numberOfDays) {
    "use strict";

    var individualMark;
    var comparisonDate;
    var newMarkData = markData;

    for (individualMark in newMarkData) {
        if (isNumberOfDaysOld(newMarkData[individualMark].lastUpdated, numberOfDays)) {
            delete newMarkData[individualMark];
        }
    }

    return newMarkData;
}

function isNumberOfDaysOld(dateValue, number) {
    "use strict";

    var comparisonDate = new Date(dateValue);
    var todaysDate = new Date();
    var msecPerDay = 1000 * 60 * 60 * 24;

    // Get the difference in milliseconds.
    var interval = todaysDate.getTime() - comparisonDate.getTime();

    // Calculate how many days the interval contains. Subtract that
    // many days from the interval to determine the remainder.
    var days = Math.floor(interval / msecPerDay);

    if (days >= number) {
        return true;
    } else {
        return false;
    }

}


